# Fite, Republic of Dagestan

}}
Fite () is a rural locality (a selo) in Agulsky District, Republic of Dagestan, Russia. The population was 751 as of 2010.
Geography
Fite is located 18&nbsp;km east of Tpig (the district's administrative centre) by road. Goa is the nearest rural locality.
